module Top_Student (
    input  J_MIC3_Pin3, // Connect from this signal to Audio_Capture.v
    input  CLK100MHZ, btnC,
    input  [15:0] sw,
    output J_MIC3_Pin1,   // Connect to this signal from Audio_Capture.v
    output J_MIC3_Pin4,   // Connect to this signal from Audio_Capture.v
    output reg [15:0] led = 0,
    output [7:0] JC,
    output reg [3:0] AN = 0,
    output reg [7:0] seg = 0
    );
    
    wire sample_CLK, clk6p25m, debounce_clk, CentreButton, f_begin, sending_p, sample_p, clock_762hz, clock_10hz; 
    wire [11:0] mic_in;
    reg [15:0] oled_data;
    reg [11:0] max;
    reg [11:0] counter; 
    wire [12:0] pixel_index;
    wire [5:0] y;
    wire [6:0] x;
    wire [1:0] display_border;
    wire [1:0] display_scheme;
    wire [1:0] display_mode;
    reg [4:0] led_count;
    reg seg_refresher = 0;
    reg breathe;
    reg [19:0] FrameCounter = 0;
     
    
    sample_clock_divider sample_clock (CLK100MHZ, sample_CLK);
    oled_clock_divider oled_clock(CLK100MHZ, clk6p25m);
    debouncing_clock_divider CLK50KHZ(CLK100MHZ, debounce_clk);
    clock_divider CLK762HZ (CLK100MHZ, 65616, clock_762hz);
    clock_divider CLK10HZ (CLK100MHZ, 4999999, clock_10hz);
    
    Audio_Capture(CLK100MHZ, sample_CLK, J_MIC3_Pin3, J_MIC3_Pin1, J_MIC3_Pin4, mic_in);
    single_pulse_output CENTRE(btnC, debounce_clk, CentreButton);
    Oled_Display display(.clk(clk6p25m), .reset(CentreButton), .frame_begin(f_begin), .sending_pixels(sending_p),
      .sample_pixel(sample_p), .pixel_index(pixel_index), .pixel_data(oled_data), .cs(JC[0]), .sdin(JC[1]), .sclk(JC[3]), .d_cn(JC[4]), .resn(JC[5]), .vccen(JC[6]),
      .pmoden(JC[7]));
      
    task oled_drawpixel(
        input [6:0] x, [5:0] y, [15:0] colour);
        if (pixel_index%96 == x && pixel_index/96 == y)
        begin
            oled_data = colour;
        end
    endtask 
    
    task oled_drawHorizontalLine(
        input [6:0] x1, [6:0] x2, [5:0]y, [15:0] colour);
        if (pixel_index%96 > x1 && pixel_index < x2 && pixel_index/96 == y)
        begin
            oled_data = colour;
        end      
    endtask
    //SW2 => 1 pixel border, 
    //SW3 => 3 pixel border,
    //default => no border 
    assign display_border = sw[2] ? 2'b01 : sw[3] ? 2'b10 : 2'b00;
    //SW4 => Scheme 1
    //SW5 => Scheme 2
    //default => default scheme
    assign display_scheme = sw[4] ? 2'b01 : sw[5] ? 2'b10 : 2'b00;
    //SW1 => volume bar appears
    //default => no volume bar
    assign display_mode = sw[1] ? 2'b01: 2'b00;
    //display vol_display(clock_10hz, display_border, display_scheme, display_mode, p_index, volume, oled_data)
    assign x = pixel_index%96;
    assign y = pixel_index/96;
    
    always @ (posedge sample_CLK) begin
        if(sw[15] == 0)
            counter <= counter + 1;
        if ( max < mic_in && counter != 4000 && sw[0] == 1)
        begin
            max <= mic_in;
        end
        if (counter == 2000)
        begin
            if (sw[0] == 0)
            begin
                max <= mic_in;
            end
            if (max <= 2048)
            begin 
                led_count <= 4'b0;
                led <= 16'd0;
            end
            else if ( max >= 2048 && max < 2176)
            begin
                led_count <= 5'd1;
                led <= 16'b0000000000000001;
            end
            else if ( max >= 2176 && max < 2304)
            begin
                led_count <= 5'd2;
                led <= 16'b0000000000000011;
            end
            else if ( max >= 2304 && max < 2432)
            begin
                led_count <= 5'd3;
                led <= 16'b0000000000000111;
            end
            else if ( max >= 2432 && max < 2560)
            begin
                led_count <= 5'd4;
                led <= 16'b0000000000001111;
            end                        
            else if ( max >= 2560 && max < 2688)
            begin
                led_count <= 5'd5;
                led <= 16'b0000000000011111;
            end
            else if ( max >= 2688 && max < 2816)
            begin
                led_count <= 5'd6;
                led <= 16'b0000000000111111;
            end
            else if ( max >= 2816 && max < 2944)
            begin
                led_count <= 5'd7;
                led <= 16'b0000000001111111;
            end
            else if ( max >= 2944 && max < 3072)
            begin
                led_count <= 5'd8;
                led <= 16'b0000000011111111;
            end                    
            else if ( max >= 3072 && max < 3200)
            begin
                led_count <= 5'd9;
                led <= 16'b0000000111111111;
            end
            else if ( max >= 3200 && max < 3328)
            begin
                led_count <= 5'd10;
                led <= 16'b0000001111111111;
            end
            else if ( max >= 3328 && max < 3456)
            begin
                led_count <= 5'd11;
                led <= 16'b0000011111111111;
            end
            else if ( max >= 3456 && max < 3584)
            begin
                led_count <= 5'd12;
                led <= 16'b0000111111111111;
            end                                
            else if ( max >= 3854 && max < 3712)
            begin
                led_count <= 5'd13;
                led <= 16'b0001111111111111;
            end
            else if ( max >= 3712 && max < 3840)
            begin
                led_count <= 5'd14;
                led <= 16'b0011111111111111;
            end
            else if ( max >= 3840 && max < 3968)
            begin
                led_count <= 5'd15;
                led <= 16'b0111111111111111;
            end
            else if ( max >= 3968 && max < 4096)
            begin
                led_count <= 5'd16;
                led <= 16'b1111111111111111;
            end

            if (sw[0] == 1)                                                                       
                max <= 0;
            counter <= 0;
        end
    end
    
    always @ (posedge clock_762hz) begin
        seg_refresher <= seg_refresher + 1;
        case (seg_refresher)
            0: 
            begin
                AN <= 4'b1110;
                case(led_count%10)
                    4'd0: seg <= 8'b11000000;
                    4'd1: seg <= 8'b11111001;
                    4'd2: seg <= 8'b10100100;
                    4'd3: seg <= 8'b10110000;
                    4'd4: seg <= 8'b10011001;
                    4'd5: seg <= 8'b10010010;
                    4'd6: seg <= 8'b10000010;
                    4'd7: seg <= 8'b11111000;
                    4'd8: seg <= 8'b10000000;
                    4'd9: seg <= 8'b10010000;
                endcase
            end
            1:
            begin
                if(led_count/10 != 0)
                begin
                    AN <= 4'b1101;
                    seg <= 8'b11111001;
                end
                else
                    AN <= 4'b1111;
            end   
        endcase
    end
    
